export const menuList = [
  { label: "Home", path: "/" },
  { label: "Project", path: "/Project" },
  { label: "Solution", path: "/Solution" },
  { label: "About Us", path: "/About" },
  { label: "Contact", path: "/Contact" },
];

export const solutionList = [
  { imgPath: "/assets/images/solution1.png", label: "3D Art", list: [] },
  {
    imgPath: "/assets/images/solution2.png",
    label: "3D Art",
    list: ["For presentation", "For media", "For game"],
  },
  {
    imgPath: "/assets/images/solution3.png",
    label: "3D Art",
    list: ["NFT", "Online", "Offline", "Website"],
  },
];

export const connectList = [
  { label: "info@newworldhouse.com", imgPath: "/assets/images/solution1.png" },
  {
    label: "discord.gg/newworldhouse",
    imgPath: "/assets/images/solution1.png",
  },
  { label: "@newworldhouse.line", imgPath: "/assets/images/solution1.png" },
  { label: "newworldhouse.ig", imgPath: "/assets/images/solution1.png" },
  { label: "@newworldhouse.fb", imgPath: "/assets/images/solution1.png" },
];
